            <p className="text-md p-8 font-thunder text-cream-carmen md:order-1 lg:max-w-[500px] lg:text-xl">
              La Bascule est lieu chargé d'histoire. La petite placette où elle
              est située s'appelle la Porte Narbonnaise. A leur arrivée, les
              Romains y avaient construit une forteresse défensive, un
              castellum, qui prit le nom de la capitale provinciale : Narbonne,
              et qui resta jusqu'au XIXe siècle le point d'entrée de la ville
              pour les voyageurs de la Via Aquitania, route de Narbonne ou de
              Foix. Guillaume Catel, Conseiller au Parlement de Toulouse,
              écrivait en 1633 : "c’estoit une ancienne forteresse, bastie par
              les Romains, ainsi que nous dirons en son lieu." De cette porte,
              qui était l'entrée monumentale au sud de Tolosa, il n'en resta
              rien, aucune description, jusqu'au moment où les fouilles
              archéologiques préventives effectuées pour la reconstruction du
              tribunal de grande instance permirent de dégager une partie de la
              porte Narbonnaise en octobre 2005.
            </p>
