            <p className="text-md p-8 font-thunder text-cream-carmen md:px-8 md:py-0 lg:max-w-[500px] lg:text-xl">
              Au XIXe siècle, sur cette porte narbonnaise, les percepteurs, à
              l'aide d'une bascule, pesaient les denrées alimentaires arrivant
              en ville et percevaient l'impôt pour la municipalité, d'où le nom
              de "La Bascule" connu encore aujourd'hui.
              <span
                className="block"
                dangerouslySetInnerHTML={{ __html: '<br/>' }}
              ></span>
              En 1964, Pierre et Angèle Maccagno y créent un café puis
              restaurant qui connait vite une solide réputation grâce à une
              carte de qualité tournée autour du gibier et du poisson. Le
              restaurant La Bascule sera ensuite tenu jusqu'en 2000 par Yves
              Pujol, restaurateur incontournable dans les années 80 / 90, chez
              qui Monsieur Claude Nougaro avait sa table réservée à l'année.
            </p>
